    height : '100vmmax' ,
    widht : '100%   '
}

const WelcomeBody =  () => {
    return (
        <div>
            <Row>
                <Col span ={24}>
                    <img   style ={stlyeImage} className = "img fluid" src ={ContainerImage}  />

                </Col>
            </Row>
        </div>
    )
}

export default WelcomeBody
